function trackComponents(){fetch(`/api/component/page/${trackingData.Page}/platform/${trackingData.PlatformId}/`).then(e=>e.json()).then(e=>{e.forEach(e=>{attachEventListener(e)})}).catch(e=>console.error(e))}function attachEventListener(item){var selectedComponents=document.querySelectorAll(`[data-componentid='${item.ComponentId}']`);null!==selectedComponents&&selectedComponents.forEach(component=>{component.addEventListener(getEventListenerByType(item.EventType),(function(){""!=item.TrackingCondition&&"true"!=eval(item.TrackingCondition)||cwTracking.trackCustomData(item.Category,item.Action,eval(item.Label))}))})}function getEventListenerByType(e){switch(e){case eventType.Click:return"click";case eventType.MouseUp:return"mouseup";case eventType.TouchEnd:return"ontouchstart"in document.documentElement?"touchend":"mouseup";case eventType.Input:return"input";default:return""}}window.eventType={Click:1,Visible:2,Change:3,Slide:4,MouseUp:5,LeadTrack:6,PqTrack:7,TouchEnd:8,Input:9},window.trackingType={OnlyGA:0,OnlyBhrigu:1,BhriguAndGA:2},docReady(trackComponents);